const state = {
    isActive: false,
    dialog: false
};
const getters = {};
const mutations = {
    setActivePage () {
        this.state.isActive = true;
    }
};
const actions = {
    setActivePage () {
        this.commit('setActivePage');
    }
};

export default {
    state,
    getters,
    mutations,
    actions,
};
